"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Erythema nodosum (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/erythema-nodosum-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H29115122\">",
"      <span class=\"h1\">",
"       What is erythema nodosum?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Erythema nodosum is a condition that causes painful red or purple bumps on the legs (",
"      <a class=\"graphic graphic_picture graphicRef83950 \" href=\"UTD.htm?8/60/9167\">",
"       picture 1",
"      </a>",
"      ). The bumps can look like bruises. Some people get erythema nodosum after an infection called &ldquo;strep throat.&rdquo; It can also happen with other conditions, or by itself.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29115137\">",
"      <span class=\"h1\">",
"       What are the symptoms of erythema nodosum?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom is painful red or purple bumps on the legs. These are usually on the shins. But some people also have bumps on the thighs, arms, or upper body.",
"     </p>",
"     <p>",
"      Some people have other symptoms before or after the bumps. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain in the joints",
"       </li>",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Feeling sick, like with the flu",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <br/>",
"      <strong>",
"      </strong>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29115152\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will do an exam and learn about your symptoms. Many different conditions can cause erythema nodosum or symptoms like it. Your doctor or nurse can order tests to check for these conditions. Tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        Chest X-ray",
"       </li>",
"       <li>",
"        A test called a &ldquo;throat culture&rdquo; &ndash; Your doctor or nurse can do this test to look for bacteria. He or she can run a swab (Q-tip) along the back of your throat and test the swab for bacteria.",
"       </li>",
"       <li>",
"        A skin test or blood test to check for tuberculosis &ndash; Tuberculosis is an infection that can cause erythema nodosum.",
"       </li>",
"       <li>",
"        A biopsy &ndash; In this test, the doctor takes a sample of tissue from one of the bumps. Another doctor looks at the tissue under a microscope. It can show if the bumps are erythema nodosum or something else. Most people do not need this test, but you might have it if your symptoms are unusual.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H29115169\">",
"      <span class=\"h1\">",
"       How is erythema nodosum treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Erythema nodosum usually gets better if the condition that is causing it goes away or is treated. As erythema nodosum gets better, the bumps start to look like bruises and then go away. They are usually gone in 2 to 8 weeks. They do not leave scars.",
"     </p>",
"     <p>",
"      While you have the bumps, you can take medicines to reduce the pain. For this, most people take medicines called &ldquo;NSAIDs.&rdquo; NSAIDs are a large group of medicines that includes",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      &nbsp;(sample brand names: Advil&reg;, Motrin&reg;),",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?0/34/550?source=see_link\">",
"       indomethacin",
"      </a>",
"      &nbsp;(sample brand names: Indocin&reg;, Indocid&reg;), and",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"       naproxen",
"      </a>",
"      &nbsp;(sample brand names: Aleve&reg;, Naprosyn&reg;).",
"     </p>",
"     <p>",
"      Talk with your doctor or nurse about which medicines you should take and how much.",
"     </p>",
