var title_f20_24_20871="Brugia life cycle";
var content_f20_24_20871=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ID%2F52000&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ID%2F52000&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 600px\">",
"   <div class=\"ttl\">",
"    Brugia life cycle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 580px; height: 467px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The typical vectors for",
"    <em>",
"     Brugia malayi",
"    </em>",
"    filariasis are mosquito species from the genera",
"    <em>",
"     Mansonia",
"    </em>",
"    and",
"    <em>",
"     Aedes",
"    </em>",
"    . During a blood meal, an infected mosquito introduces third-stage filarial larvae onto the skin of the human host, where they penetrate into the bite wound",
"    <strong>",
"     (1)",
"    </strong>",
"    . They develop into adults that commonly reside in the lymphatics",
"    <strong>",
"     (2)",
"    </strong>",
"    . The adult worms resemble those of",
"    <em>",
"     Wuchereria bancrofti",
"    </em>",
"    , but are smaller. Female worms measure 43 to 55 mm in length by 130 to 170 &micro;m in width, and males measure 13 to 23 mm in length by 70 to 80 &micro;m in width. Adults produce microfilariae, measuring 177 to 230 &micro;m in length and 5 to 7 &micro;m in width, which are sheathed and have nocturnal periodicity. The microfilariae migrate into lymph and enter the blood stream reaching the peripheral blood",
"    <strong>",
"     (3)",
"    </strong>",
"    . A mosquito ingests the microfilariae during a blood meal",
"    <strong>",
"     (4)",
"    </strong>",
"    . After ingestion, the microfilariae lose their sheaths and work their way through the wall of the proventriculus and cardiac portion of the midgut to reach the thoracic muscles",
"    <strong>",
"     (5)",
"    </strong>",
"    . There the microfilariae develop into first-stage larvae",
"    <strong>",
"     (6)",
"    </strong>",
"    and subsequently into third-stage larvae",
"    <strong>",
"     (7)",
"    </strong>",
"    . The third-stage larvae migrate through the hemocoel to the mosquito's proboscis",
"    <strong>",
"     (8)",
"    </strong>",
"    and can infect another human when the mosquito takes a blood meal",
"    <strong>",
"     (1)",
"    </strong>",
"    .",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Centers for Disease Control and Prevention. Parasites and Health: Filariasis. Available at:",
"     <a href=\"file://dpd.cdc.gov/dpdx/html/Filariasis.htm\" target=\"_blank\">",
"      file://dpd.cdc.gov/dpdx/html/Filariasis.htm",
"     </a>",
"     .",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
