var title_f20_24_20875="Dx criteria hypochondria";
var content_f20_24_20875=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F68413&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F68413&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    DSM-IV-TR diagnostic criteria for hypochondriasis",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <strong>",
"         A.",
"        </strong>",
"        Preoccupation with fears of having, or the idea that one has, a serious disease based on the person's misinterpretation of bodily symptoms.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         B.",
"        </strong>",
"        The preoccupation persists despite appropriate medical evaluation and reassurance.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         C.",
"        </strong>",
"        The belief in Criterion A is not of delusional intensity (as in delusional disorder, somatic type) and is not restricted to a circumscribed concern about appearance (as in body dysmorphic disorder).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         D.",
"        </strong>",
"        The preoccupation causes clinically significant distress or impairment in social, occupational, or other important areas of functioning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         E.",
"        </strong>",
"        The duration of the disturbance is at least six months.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         F.",
"        </strong>",
"        The preoccupation is not better accounted for by generalized anxiety disorder, obsessive-compulsive disorder, panic disorder, a major depressive episode, separation anxiety, or another somatoform disorder.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reprinted with permission from: the Diagnostic and Statistical Manual of Mental Disorders, Text Revision, Fourth Edition. Copyright &copy; 2000 American Psychiatric Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
