var title_f20_24_20876="Warning signs of elder mistreatment";
var content_f20_24_20876=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F67380&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F67380&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    History and warning signs for elder mistreatment/abuse",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       History",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Advanced age (&gt;80 years)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Disability in self-care",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Dementia",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Depression",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       History of hip fracture",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       History of stroke",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Social isolation",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Poor socioeconomic status",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       External family stressors",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Unfavorable caretaker characteristics*",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Indicators of financial exploitation&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Institutional staffing shortages",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Inappropriate or excessive medications; failure to get needed medications; lack of appropriate monitoring of medications and their effects",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Substance abuse",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Physical/mental status examination",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Indicators of sexual abuse: pain, bruises, lacerations, bleeding in anal-genital areas; bruised breasts or abdomen; signs of venereal diseases",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Lacerations (including large skin tears, abrasions, burns, and bruises) without adequate explanation, especially on the trunk or other unusual locations",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Suspicious fractures in sites other than those seen in osteoporotic fractures ie wrist, hip or vertebral body",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Malnutrition",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Focal findings on neurologic examination",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Signs of dehydration",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pressure ulcers",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Dementia, psychiatric disorders, lack of mental capacity",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Unfavorable caretaker characteristics - Mental illness, substance abuse, history of violent or antisocial behavior, depression, or financial dependency on the victim. (Lachs, MS, Pillemer, K. Elder abuse. Lancet 2004; 364:1265. Lachs, MS, Pillemer, K. Abuse and Neglect of Elderly Persons. The New England Journal of Medicine 1995; 332.)",
"     <br>",
"      &bull; Indicators of financial exploitation - Inability to pay for services (utilities, rent, medications, food) that the elder was previously able to pay for. Transfers of property when the elder lacks the capacity to consent. (Reed, K. When Elders Lose their Cents: Financial Abuse of the Elderly. Clinics in Geriatric Medicine 2005; 21.)",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
